import styles from './ReportForm.module.css'

import { FormControl, FormLabel, RadioGroup, FormControlLabel } from '@material-ui/core';
import Radio from '@material-ui/core/Radio';

import React, { useState } from 'react';



function ReportForm({ open, onCancel }: { open: boolean, onCancel: any }) {
    return (
        <div onClick={onCancel} className={styles.box} style={{ display: open ? 'block' : 'none' }}>
            <div onClick={(e) => { e.stopPropagation() }} className={styles.contentBox}>
                <FormDisabledDemo />
            </div>
        </div>
    )
}

export default ReportForm;




const normFile = (e: any) => {
    if (Array.isArray(e)) {
        return e;
    }
    return e?.fileList;
};

const FormDisabledDemo: React.FC = () => {
    const [actionType, setActionType] = useState("1");

    return (
        <>
            <div className={styles.title1}>GSK 不良事件报告表</div>
            <div className={styles.title2}>机构/项目信息</div>
            <FormControl component="fieldset">
                <RadioGroup row aria-label="position" name="position" defaultValue='1'>
                    <FormLabel component="legend" style={{ color: '#666' , backgroundColor:'red', lineHeight:'10'}}>*活动类型</FormLabel>
                    <FormControlLabel labelPlacement="start" value="1" control={<Radio />}  label={<div style={{color:'#666', fontSize:14}}>市场研究</div>} />
                    <FormControlLabel labelPlacement="start" value="2" control={<Radio />} label={<div style={{color:'#666', fontSize:14}}>患者支持项目</div>} />
                    <FormControlLabel labelPlacement="start" value="3" control={<Radio />} label={<div style={{color:'#666', fontSize:14}}>数字媒体</div>} />
                </RadioGroup>
            </FormControl>
        </>
    );
};
